/**
 * setValue method comment.
 */
public void setValue(Object o) 
{
	if( o == null )
		return;

	YukonGroup group = (YukonGroup)o;

	getJTextFieldGroupName().setText( group.getYukonGroup().getGroupName() );
	getJEditorPaneDesc().setText( group.getYukonGroup().getGroupDescription() );



	DefaultDatabaseCache cache = DefaultDatabaseCache.getInstance();
	synchronized( cache )
	{
		List grpMembers = (List)cache.getYukonGroupUserMap().get( LiteFactory.createLite(group.getYukonGroup()) ) ;
		
		if( grpMembers != null )
			getJListMembers().setListData( grpMembers.toArray() );
	}
	
}

